import React from 'react'

export const Searchbar = ({searchQuery, handleSearch}) => {
  return (
    <div className="search-bar-container">
      <input
        type="text"
        placeholder="Search movies..."
        onChange={(e) => handleSearch(e.target.value)}
      />
    </div>
  )
}
